import './HomePage.css';
import { Link } from 'react-router-dom';

//import
import Category from '../../components/Category/Category.js';
import '../../resources/importstyle/Carousel.css'

/* -- Images -- */
import Banner1 from '../../resources/images/banner2.jpg' 
import Banner2 from '../../resources/images/banner3.jpg'
import Banner3 from '../../resources/images/IMG_78061-ezgif.com-webp-to-png-converter.png'
import Category1 from '../../resources/images/top-categ1.jpg';
import Category2 from '../../resources/images/top-categ2.jpg'
import Category3 from '../../resources/images/top-categ3.jpg'
import Category4 from '../../resources/images/top-categ4.jpg'
function HomePage() {

  const carouselImages = [Banner1 , Banner2, Banner3];
  const categoryNames = ['Upcoming', '7 Day Auction', '24hr Auction', '30 Day Auction'];
  const categoryImages = [Category1, Category2, Category3, Category4];
  const categoryLinks = ['https://www.google.com'];

  //component requires a require. cant import
  var Carousel = require('react-responsive-carousel').Carousel;


  return (
    <>
        <div className='homepage'>
          <div className='homepage-carousel'>
            <Carousel>
              <div>
                  <img src={carouselImages[2]} />
                  <div className='homepage-carousel-objects'>
                    <h1>A CHANCE TO WIN A MOONSWATCH</h1>
                    <p>Sign up to become a Zeroto60s auction seller, sell your luxury watches with us.</p>
                    <Link to={'/signup'}><button>Register Now</button></Link>
                  </div>
              </div>
              <div>
                  <img src={carouselImages[0]} />
                  <div className='homepage-carousel-objects'>
                    <h1>BECOME A SELLER</h1>
                    <p>Sign up to become a Zeroto60s auction seller, sell your luxury watches with us.</p>
                    <Link to={'/signup'}><button>Register Now</button></Link>
                  </div>
              </div>
              <div>
                  <img src={carouselImages[1]} />
                  <div className='homepage-carousel-objects'>
                    <h1>NEW LISTINGS EVERY WEDNESDAY</h1>
                    <p>Be sure to check back every Wednesday at 12:30 PM (pst) for fresh listings</p>
                    <Link to={'/signup'}><button>Latest Listings</button></Link>
                  </div>
              </div>
            </Carousel>
          </div>
          <div className='category-title'><p>Categories</p></div>
          <div className='homepage-categories'>

              <Category className="homepage-caregory-item"
                imageSrc={categoryImages[0]}
                categoryName={categoryNames[0]}
                categoryLink={categoryLinks[0]}
              />
              <Category className="homepage-caregory-item"
                imageSrc={categoryImages[1]}
                categoryName={categoryNames[1]}
                categoryLink={categoryLinks[0]}
              />
              <Category className="homepage-caregory-item"
                imageSrc={categoryImages[2]}
                categoryName={categoryNames[2]}
                categoryLink={categoryLinks[0]}
              />
              <Category className="homepage-caregory-item"
                imageSrc={categoryImages[3]}
                categoryName={categoryNames[3]}
                categoryLink={categoryLinks[0]}
              />
          </div>
        </div>

    </>


  );
}

export default HomePage;
